import Card from "./cards";

export default function App() {
  const price = [
    {
      plan: "Intro",
      price: "$19",
      desc: "for most business that want for optimize web queries",
      item: {
        0: "All limited links",
        1: "Own analytics platform",
        2: "Chat support",
        3: "Optimize hashtags",
        4: "Unlimited users",
      },
    },
  ];
  return (
    <div>
      {price.map((p) => {
        if (p.plan === "Intro") {
          return (
            <>
              <Card plan={(p.plan, p.price)}></Card>
            </>
          );
        }
      })}
    </div>
  );
}
